import logo from "../img/logo.png"

const HomePage = () => {

    const history = useHistory ()

    const seeTrip = () => {
        history.push("/trips/:list")
    }


    const adminPage = () => {
        history.push("/login")
    }


    return (
        
            <HomeBox>
                <Header/>
            <img src={logo}/> 
            <div>
            <button onClick={seeTrip}>Ver Viagens</button>
            <button onClick={adminPage}>√Årea Admin</button>
            </div>
            </HomeBox>
        
    )
   
}

export default HomePage;
